INSERT INTO "posts" ("id", "user_id", "content", "image_url", "video_url", "created_at", "updated_at", "is_deleted") VALUES ('82', '54', 'Tum ne efficit quidem, quod vult. Nam et complectitur verbis, quod vult, et dicit plane, quod intellegam; et tamen ego a philosopho, si afferat eloquentiam, non asperner, si non habeat, non admodum indoctis, totum hoc displicet philosophari. Quidam autem.', 'https://flavors.me/nec/vero/hoc/oratione/sempiternum.bat?esse', 'https://typepad.com/esse/expetendam/et/dolorem/tamen.psd1?culpa&qui&officia&deserunt&mollit', '2024-01-29 20:07:33', '2024-01-31 12:24:56', '0');
INSERT INTO "posts" ("id", "user_id", "content", "image_url", "video_url", "created_at", "updated_at", "is_deleted") VALUES ('83', '89', 'Si effecerit, et opes vel fortunae vel ingenii liberalitati magis conveniunt, qua qui utuntur, benivolentiam sibi conciliant et, quod aptissimum est ad cognitionem omnium, regula, ad quam omnia.', 'http://naver.com/non/tu/puto.odf?status&perturbatur', 'https://imageshack.us/etiam/bestiae/paene/loquuntur/magistra/perferendis.gpg?ibidem&homo&acutus', '2024-01-29 20:14:37', '2024-02-03 09:17:13', '1');
INSERT INTO "posts" ("id", "user_id", "content", "image_url", "video_url", "created_at", "updated_at", "is_deleted") VALUES ('84', '83', 'Voluptas esset bonum, desideraret.'' -- Ita credo. -- ''Non est igitur voluptas bonum.'' Hoc ne statuam quidem dicturam pater aiebat.', 'https://home.pl/cum/aliquid.jpeg?nihil', 'https://so-net.ne.jp/si/urbes/si/gymnasia/si/haec.aac?magni&dolores&eos', '2024-01-29 20:15:51', '2024-02-02 14:54:58', '1');
INSERT INTO "posts" ("id", "user_id", "content", "image_url", "video_url", "created_at", "updated_at", "is_deleted") VALUES ('85', '53', 'Fieri propter voluptatem; cum autem usus.', 'https://jimdo.com/naturae/finibus/contentus/sine/putemus.bz2?procedat&oratio&quaerimus&igitur&quid', 'https://cloudflare.com/de/iustitia/iudicandum/hanc.mkv?', '2024-01-29 20:22:16', '2024-02-06 21:38:13', '0');
INSERT INTO "posts" ("id", "user_id", "content", "image_url", "video_url", "created_at", "updated_at", "is_deleted") VALUES ('86', '56', 'Fortunae vel ingenii liberalitati magis conveniunt, qua qui affecti sunt in eadem causa sunt, qua ante quam nati, et ad usus civium non inutile, nosque ea scripta reliquaque eiusdem generis et legimus libenter et legemus --, haec, quae vitam.', 'http://friendfeed.com/mediocris/ego/autem/quem/timeam/quae.url?eum&iure&reprehenderit', 'https://qq.com/certe/audiam/quid/et.yml?cum&omni', '2024-01-29 20:28:51', '2024-02-02 07:58:00', '0');
INSERT INTO "posts" ("id", "user_id", "content", "image_url", "video_url", "created_at", "updated_at", "is_deleted") VALUES ('87', '22', 'Numquam vim tantam habent, ut non modo singulos homines, sed universas familias evertunt, totam etiam labefactant saepe rem publicam. Ex cupiditatibus odia, discidia, discordiae.', 'https://nsw.gov.au/iuberet/reque/ex/utraque/motum.dbf?summumque&malum', 'https://opensource.org/studiis/quamquam/te/quidem/voluptate.odg', '2024-01-29 20:35:30', '2024-02-06 09:15:01', '1');
INSERT INTO "posts" ("id", "user_id", "content", "image_url", "video_url", "created_at", "updated_at", "is_deleted") VALUES ('88', '11', 'Perfruique maximis et animi et corporis voluptatibus, videtisne quam nihil praetermittatur quod vitam adiuvet, quo facilius id, quod ipsi statuerunt, non possunt.', 'https://toplist.cz/metuque/omnium.json', 'https://barnesandnoble.com/vel/plurimum/afferat/nam/ut.vcd?quidem', '2024-01-29 20:41:56', '2024-02-02 19:09:15', '1');
INSERT INTO "posts" ("id", "user_id", "content", "image_url", "video_url", "created_at", "updated_at", "is_deleted") VALUES ('89', '14', 'Levius aliquando, nulla praeterea neque praesenti nec expectata voluptate, quid eo miserius dici aut fingi potest? Quodsi vita doloribus referta maxime fugienda est, summum bonum consequamur? Clamat.', 'https://live.com/pondere/ad/lineam/hunc/quae.wav?posset&nec&ulla&pars', 'https://list-manage.com/explicatis/et/triarius.wmv?patiatur&earumque&assidua&recordatione', '2024-01-29 20:50:42', '2024-01-30 21:33:26', '1');
INSERT INTO "posts" ("id", "user_id", "content", "image_url", "video_url", "created_at", "updated_at", "is_deleted") VALUES ('90', '32', 'Maiores esse et muniti videntur, deorum tamen horrent.', 'https://weebly.com/sanguinem/suum/tam/vacuitate.dbf?dici&ab&illo&recta', 'https://nsw.gov.au/utilitate/sanciret.avi?velit&esse&quam&nihil&praetermittatur', '2024-01-29 20:54:44', '2024-02-02 03:21:28', '1');
INSERT INTO "posts" ("id", "user_id", "content", "image_url", "video_url", "created_at", "updated_at", "is_deleted") VALUES ('91', '57', 'Aut inpotenti iniuste facta conducunt, qui nec facile efficere possit, quod conetur, nec optinere, si effecerit, et opes vel fortunae vel ingenii liberalitati magis conveniunt, qua qui utuntur, benivolentiam sibi.', 'https://arizona.edu/tempus/est/ullum/inertissimae.dbx', 'https://jigsy.com/si/amicitiam/propter/quasi.htm?adversarium&aliquem&convincere&accurate', '2024-01-29 20:59:07', '2024-01-30 00:02:49', '0');
INSERT INTO "posts" ("id", "user_id", "content", "image_url", "video_url", "created_at", "updated_at", "is_deleted") VALUES ('92', '29', 'Tum illud in primis, quod, cum in rerum natura duo quaerenda sint, unum, quae materia sit, ex qua quaeque res.', 'https://freewebs.com/ad/voluptatem/sapientia/quos.psc1?andriam&terentii&quam', 'http://msu.edu/legant/ut.mp3?recte', '2024-01-29 21:01:03', '2024-02-02 22:15:06', '0');
INSERT INTO "posts" ("id", "user_id", "content", "image_url", "video_url", "created_at", "updated_at", "is_deleted") VALUES ('93', '96', 'Deterritum. Quae cum dixissem, magis ut illum provocarem quam ut ipse loquerer, tum Triarius leniter arridens: Tu quidem, inquit, totum Epicurum paene e philosophorum choro sustulisti. Quid ei reliquisti, nisi.', 'https://fda.gov/possunt/quod/disserunt/omittantur.sh?tot', 'https://usnews.com/quam/utramque/menandri/legam/a/solum.mdb?graviter&ornateque&dictas&quis&non', '2024-01-29 21:10:34', '2024-02-03 12:07:27', '0');
INSERT INTO "posts" ("id", "user_id", "content", "image_url", "video_url", "created_at", "updated_at", "is_deleted") VALUES ('94', '2', 'Consuetudine facilius fieri poterit et iustius? Sunt autem, qui dicant foedus esse quoddam sapientium, ut ne minus amicos quam se ipsos diligant. Quod et acutum genus.', 'https://un.org/et/sunt/illius/scripta/leviora/minima.json?ad&minim&veniam&quis&nostrud', 'https://domainmarket.com/de/finibus/bonorum/et/malorum/vivere.dbx?ponit&quibus&si&semel', '2024-01-29 21:12:41', '2024-02-04 09:37:52', '0');
INSERT INTO "posts" ("id", "user_id", "content", "image_url", "video_url", "created_at", "updated_at", "is_deleted") VALUES ('95', '52', 'Effugiendorum gratia. Sed de clarorum hominum factis illustribus et gloriosis satis hoc loco dictum sit. Erit enim iam de omnium virtutum cursu ad voluptatem proprius disserendi locus. Nunc.', 'https://amazon.de/saepe/formidines/denique/etiam/mihi.js?etiam&praetereat&omnes&voluptates&dolores', 'https://time.com/eo/eas.gif?impediri&rationem&amicitiae', '2024-01-29 21:19:01', '2024-02-01 23:26:03', '0');
INSERT INTO "posts" ("id", "user_id", "content", "image_url", "video_url", "created_at", "updated_at", "is_deleted") VALUES ('96', '8', 'Neque sapientium non beatus. Multoque hoc melius nos veriusque quam.', 'https://cmu.edu/sunt/quem/ad/modum/temeritas/polyaeno.vcd?cum', 'https://latimes.com/causa/graecum.gif', '2024-01-29 21:26:54', '2024-02-06 01:27:08', '0');
INSERT INTO "posts" ("id", "user_id", "content", "image_url", "video_url", "created_at", "updated_at", "is_deleted") VALUES ('97', '36', 'Natura cupiditatum generibusque earum explicatis, et, ut dixi, ad lineam, numquam fore ut hic noster labor in varias reprehensiones incurreret. Nam quibusdam, et iis quidem non admodum indoctis, totum hoc.', 'https://cdc.gov/hoc/commune/naturae.wav?cum&multa&non&probo&tum', 'http://paginegialle.it/qui/omnino/avocent/a/de.mdb?conducunt&qui&nec&facile', '2024-01-29 21:31:34', '2024-02-03 01:34:58', '0');
INSERT INTO "posts" ("id", "user_id", "content", "image_url", "video_url", "created_at", "updated_at", "is_deleted") VALUES ('98', '21', 'Animi doloribus torqueantur, sapientia est adhibenda, quae et terroribus cupiditatibusque detractis et.', 'http://ezinearticles.com/finibus/contentus/sine/aegritudine/possit/spe.bin?praesentibus', 'http://ted.com/usque/ad/necessarius.html', '2024-01-29 21:39:02', '2024-02-06 21:31:36', '0');
INSERT INTO "posts" ("id", "user_id", "content", "image_url", "video_url", "created_at", "updated_at", "is_deleted") VALUES ('99', '66', 'Vel summum bonorum vel ultimum vel extremum -- quod Graeci telos nominant --, quod ipsum nullam ad aliam rem, ad id autem res referuntur omnes, fatendum est summum.', 'https://mapquest.com/putemus/tota/amicitia/quasi/claudicare/a.jks?semper&sollicitant&turbulentaeque', 'https://nytimes.com/delectari/legantur.sh?humili&animo&inbecilloque&ferre', '2024-01-29 21:48:24', '2024-01-31 12:25:06', '0');
INSERT INTO "posts" ("id", "user_id", "content", "image_url", "video_url", "created_at", "updated_at", "is_deleted") VALUES ('100', '30', 'Ab Homero Ennius, Afranius a Menandro solet. Nec vero, ut noster Lucilius, recusabo, quo minus id, quod maxime placeat, facere possimus, omnis voluptas assumenda est, omnis dolor repellendus. Temporibus autem quibusdam et aut officiis debitis aut rerum necessitatibus saepe eveniet, ut et.', 'https://unc.edu/quidem/non.xlsx?uti&oratione', 'https://foxnews.com/rem/publicam/ex/cupiditatibus/solemus.gpg', '2024-01-29 21:50:35', '2024-02-01 23:16:33', '0');
