INSERT INTO "user_activities" ("id", "user_id", "activity_type", "related_entity_id", "description", "created_at") VALUES ('1', '81', 'Unsubscribe', '7239', 'Tam invidus, qui ab eo dissentiunt, sed certe non probes, eum quem ego arbitror unum vidisse.', '2024-01-29 12:51:07');
INSERT INTO "user_activities" ("id", "user_id", "activity_type", "related_entity_id", "description", "created_at") VALUES ('2', '53', 'Subscribe', '9583', 'Adversa quasi perpetua oblivione obruamus et secunda iucunde ac suaviter meminerimus. Sed cum ea, quae audiebamus, conferebamus, neque erat umquam controversia, quid ego intellegerem, sed quid probarem. Quid igitur est? Inquit; audire enim cupio, quid non probes. Principio, inquam, in physicis, quibus maxime gloriatur, primum totus est alienus. Democritea dicit perpauca mutans, sed ita, ut ea.', '2024-01-29 12:53:14');
INSERT INTO "user_activities" ("id", "user_id", "activity_type", "related_entity_id", "description", "created_at") VALUES ('3', '17', 'Upload', '3462', 'Non potest. Atque ut odia, invidiae, despicationes adversantur voluptatibus, sic amicitiae non posse iucunde vivi, nisi sapienter, honeste.', '2024-01-29 12:57:57');
INSERT INTO "user_activities" ("id", "user_id", "activity_type", "related_entity_id", "description", "created_at") VALUES ('4', '16', 'Subscription Renewal', '6703', 'E corporis voluptatibus et doloribus -- itaque concedo, quod modo dicebas, cadere causa, si qui e nostris aliter existimant, quos quidem video minime esse deterritum. Quae cum dixissem, magis ut illum provocarem.', '2024-01-29 12:59:32');
INSERT INTO "user_activities" ("id", "user_id", "activity_type", "related_entity_id", "description", "created_at") VALUES ('5', '24', 'Send Message', '4505', 'Temporis. Quod quia nullo modo probantur, tamen Democritum laudatum a ceteris ab hoc, qui eum unum secutus esset, nollem vituperatum. Iam in altera philosophiae parte. Quae est quaerendi ac disserendi, quae logikh dicitur, iste vester plane, ut mihi quidem videtur. Ac fieri potest, ut propemodum iustioribus utamur illis.', '2024-01-29 13:00:38');
INSERT INTO "user_activities" ("id", "user_id", "activity_type", "related_entity_id", "description", "created_at") VALUES ('6', '32', 'Rate', '8407', 'Dolor in reprehenderit in voluptate velit esse, quam nihil praetermittatur quod vitam adiuvet, quo facilius id, quod sentiant non esse faciendum, ii voluptatem maximam adipiscuntur praetermittenda voluptate. Idem etiam dolorem saepe perpetiuntur.', '2024-01-29 13:04:08');
INSERT INTO "user_activities" ("id", "user_id", "activity_type", "related_entity_id", "description", "created_at") VALUES ('7', '77', 'Comment', '8657', 'In longinquitate levis, in gravitate brevis soleat esse, ut ad Orestem pervenias profectus a Theseo. At vero Epicurus una in domo, et ea quidem.', '2024-01-29 13:13:58');
INSERT INTO "user_activities" ("id", "user_id", "activity_type", "related_entity_id", "description", "created_at") VALUES ('8', '43', 'Send Message', '4715', 'Nihil asperum nisi dolorem, de quibus neque depravate iudicant neque corrupte, nonne ei maximam gratiam habere debemus, qui hac exaudita quasi voce naturae sic.', '2024-01-29 13:15:00');
INSERT INTO "user_activities" ("id", "user_id", "activity_type", "related_entity_id", "description", "created_at") VALUES ('9', '2', 'Update Profile', '4150', 'Nescio quam illam umbram, quod appellant honestum non tam id reprehendunt, si remissius agatur, sed tantum studium tamque multam operam.', '2024-01-29 13:22:45');
INSERT INTO "user_activities" ("id", "user_id", "activity_type", "related_entity_id", "description", "created_at") VALUES ('10', '90', 'Password Change', '6039', 'Voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat.', '2024-01-29 13:32:10');
INSERT INTO "user_activities" ("id", "user_id", "activity_type", "related_entity_id", "description", "created_at") VALUES ('11', '50', 'Rate', '1906', 'Sententia tale debet esse, ut ad Orestem pervenias profectus a Theseo. At vero Epicurus una in domo, et ea quidem angusta, quam magnos quantaque amoris conspiratione consentientis tenuit amicorum greges! Quod fit etiam nunc ab Epicureis. Sed ad haec, nisi.', '2024-01-29 13:37:46');
INSERT INTO "user_activities" ("id", "user_id", "activity_type", "related_entity_id", "description", "created_at") VALUES ('12', '13', 'Check-in', '7451', 'Severa sit. Non enim hanc solam sequimur, quae suavitate aliqua naturam ipsam movet et cum iucunditate quadam percipitur sensibus, sed maximam voluptatem illam habemus, quae percipitur omni dolore careret, non.', '2024-01-29 13:43:33');
